            "Бизнес – совокупность материальных, финансовых, ",
            "трудовых и информационных ресурсов в целях производства ",
            "товаров, предназначенных для продажи другим ",
            "экономическим агентам - предприятиям.",
            "",
            "Товар – все, что может удовлетворить потребность",
            "или нужду и предлагается рынку с целью привлечения",
            "внимания, приобретения, использования или потребления.",
            "",
            "Рынок – это совокупность существующих или ",
            "потенциальных продавцов и покупателей каких-то товаров.",
            "",
            "Спрос – это потребность человека в продукции или услуге. ",
            "",
            "Предложение – это товары либо услуги, которые сейчас ",
            "присутствуют на рынке и отражают потребности продавца ",
            "в их реализации.",
            "",
            "Конкуренция — это соперничество между людьми, ",
            "предприятиями, организациями, территориями, которые ",
            "заинтересованы в достижении одной цели. ",
            "",
            "Посредник — это лицо, стоящее между производителем и ",
            "потребителем товара и содействующая его товарообороту. ",
            "",
            "Планирование - управленческая деятельность, которая ",
            "предусматривает выработку стратегии и тактики ведения ",
            "производственно-хозяйственной деятельности.",
            "",
            "Деловой этикет – важнейшая сторона профессионального ",
            "поведения делового человека, менеджера, предпринимателя. ",
            "",
            "Дерево целей — структурированная, построенная по ",
            "иерархическому принципу совокупность целей организации, ",
            "в которой выделены главная цель и подчиненные ей подцели ",
            "первого, второго и последующих уровней.",
            ""});
